import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header/Header'
import Home from './Pages/Home/Home';
import Result from './Pages/Result/Result';
function App() {
return (
  <BrowserRouter>
  <div classname='app' >

<Header/>
<Routes>
  <Route path='/' exact>
    <Home />
      </Route>
      <Route path='/' exact>
    <Qui />
      </Route>
      <Route path='/' exact>
    <Result />
      </Route>
</Routes>
</div>
  </BrowserRouter>
);
}

export default App;
